      <div class="row">
            <div class="col-xs-6 col-sm-6 col-md-6 col-lg-6">

            </div>
        </div>
        <div class="row">
            <div class="col-xs-6 col-sm-6 col-md-6 col-lg-6">

            </div>
        </div>
    </div>
  );
}

export default App;
